function Home(props: any) {
  return (
    <>
      <div>
        <img src="./JoelHiltonHeadshot.jpg" alt="JoelHiltonHeadshot"></img>
      </div>
      <div className="col align-self-center text-start">
        <h1>{props.saying}</h1>
        <h4>
          Joel loves to make podcasts and watch movies, check out his latest
          interests on this site!
        </h4>
      </div>
    </>
  );
}

function Podcasts() {
  return (
    <>
      <div>
        <p>Checkout Joel's Podcasts</p>
        <a href="https://baconsale.com">My Podcasts</a>
      </div>
    </>
  );
}

export default Home;
export default Podcasts;
